// TodoList.js
import React from 'react';

class TodoList extends React.Component {
  render() {
    const { tasks, removeTask } = this.props;

    return (
      <div>
        <ul>
          {tasks.map((task, index) => (
            <li key={index}>
              {task}
              <button onClick={() => removeTask(index)}>Ta bort</button>
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default TodoList;
